/* START "InPlaceEdit.less" */
/* ====================================== */
/* CSS for control sap.ca.ui/InPlaceEdit  */
/* Fiori 3 theme                          */
/* ====================================== */

.sapCaUiIpe {
    height:3rem;

    &:not(.sapCaUiIpeEdit) {
         padding: 0.125rem;
    }

    .sapMText, .sapCaUiIpeCont {
        height:2.5rem;
    }

    .sapMText {
        line-height:2.5rem;
    }

    .sapMBtn {
        height:100%
    }

    .sapCaUiIpeCont {
        font-size: 0.875rem;
        line-height: 2.375rem;

        .sapCaUiIpeEBtn {
            height: 2.375rem;
            width: 2.375rem;
            line-height: 2.375rem;
            padding:0;

            & > .sapMBtnInner {
                border:none;
            }
        }
    }
}
