	border-radius: var(--sapElement_BorderCornerRadius);
}
/* END "QuickView.less" */

/* START "RadioButton.less" */
/* ================================== */
/* CSS for control sap.m/RadioButton  */
/* Fiori 3 theme                      */
/* ================================== */

.sapMRb {
	height: 2.75rem;

	.sapMRbBOut {
		stroke-width: 0.125rem;
	}

	&:not(.sapMRbErr):not(.sapMRbWarn):not(.sapMRbInfo) {

		.sapMRbBOut {
			stroke-width: var(--sapField_BorderWidth);
		}
	}
}

.sapMRb .sapMRbB {
	height: 2.75rem;
	line-height: 2.75rem;
	width: 2.75rem;
}

.sapMRb > .sapMRbBLabel {
	line-height: 2.75rem;
	height: 2.75rem;
}

.sapMRbSvg {
	margin: 0.6875rem;
}

.sapMRbHasLabel.sapMRb:focus::before {
	bottom: .5rem;
	top: 0.5rem;
	left: 0.5rem;
	right: 0;
}

/* Right to left */
.sapMRbG[dir=rtl] .sapMRbHasLabel.sapMRb:focus::before {
	left: 0;
	right: 0.5rem;
}

.sapMRbHasLabel .sapMRbB {
	width: 2.75rem;
}

/* Align RadioButton in Form with other controls */
.sapUiForm.sapUiFormEdit-CTX {

	.sapMRb > .sapMRbB {
		width: 2.1875rem;
	}
}

.sapUiSizeCompact {

	.sapMRbB {
		height:2rem;
		line-height: 2rem;
		width: 2rem;
	}

	.sapMRb > .sapMLabel {
		height: 2rem;
		line-height: 2rem;
	}

	.sapMRb:focus::before {
		bottom: 0.325rem;
		top: 0.325rem;
		left: 0.325rem;
		right: 0.325rem;
	}
}

.sapMRb:not(.sapMRbErr):not(.sapMRbWarn):not(.sapMRbInfo):not(.sapMRbSucc) .sapMRbHoverable:hover .sapMRbBOut {
	stroke: var(--sapField_Hover_BorderColor);
	fill: var(--sapField_Hover_Background);
}

.sapMRb:focus::before {
	border: var(--sapContent_FocusWidth) var(--sapContent_FocusStyle) var(--sapContent_FocusColor);
	bottom: 0.5rem;
	top: 0.5rem;
	left: 0.5rem;
	right: 0.5rem;
}

.sapMLIBActive .sapMRbB .sapMRbBOut {
	border: 1px solid var(--sapList_Active_TextColor);
}

.sapMLIBActive .sapMRbSel .sapMRbBOut {
	background-color: var(--sapList_Active_Background);
}

.sapMRbDis {
	opacity: var(--sapContent_DisabledOpacity);
}

/* Value states */

.sapMRbErr.sapMRbSel,
.sapMRbErr.sapMRbSel.sapMRbRo {

	.sapMRbBInn {
		fill: var(--sapField_InvalidColor);
		stroke: none;
	}
}

.sapMRbErr,
.sapMRbErr.sapMRbBTouched {

	.sapMRbB .sapMRbBOut {
		stroke: var(--sapField_InvalidColor);
		fill: var(--sapField_InvalidBackground);
	}
}

.sapMRbWarn.sapMRbSel,
.sapMRbWarn.sapMRbSel.sapMRbRo {

	.sapMRbBInn {
		fill: var(--sapField_TextColor);
		stroke: none;
	}
}

.sapMRbWarn,
.sapMRbWarn.sapMRbBTouched {

	.sapMRbB .sapMRbBOut {
		stroke: var(--sapField_WarningColor);
		fill: var(--sapField_WarningBackground);
	}
}

.sapMRbSucc.sapMRbSel,
.sapMRbSucc.sapMRbSel.sapMRbRo {

	.sapMRbBInn {
		fill: var(--sapField_SuccessColor);
		stroke: none;
	}
}

.sapMRbSucc,
.sapMRbSucc.sapMRbBTouched {

	.sapMRbB .sapMRbBOut {
		stroke: var(--sapField_SuccessColor);
		fill: var(--sapField_SuccessBackground);
	}
}

.sapMRbInfo.sapMRbSel,
.sapMRbInfo.sapMRbSel.sapMRbRo {

	.sapMRbBInn {
		fill: var(--sapField_InformationColor);
		stroke: none;
	}
}

.sapMRbInfo,
.sapMRbInfo.sapMRbBTouched {

	.sapMRbB .sapMRbBOut {
		stroke: var(--sapField_InformationColor);
		fill: var(--sapField_InformationBackground);
	}
}
/* END "RadioButton.less" */

/* START "RadioButtonGroup.less" */
/* ================================== */
/* CSS for control sap.m/RadioButtonGroup  */
/* Fiori 3 theme                      */
/* ================================== */

@_sap_m_RadioButtonGroup_WidthWithLabel: 2.75rem;
@_sap_m_RadioButtonGroup_PaddingLeftLabel: 2.75rem;
@_sap_m_RadioButtonGroup_PaddingLeftLabel_Form: 2.1875rem;
/* END "RadioButtonGroup.less" */

/* START "RangeSlider.less" */
/* ================================== */
/* CSS for control sap.m/RangeSlider  */
/* Fiori 3 theme                      */
/* ================================== */

/* overlap */
.sapMSliderHandle.sapMSliderHandleOverlap {
	border: 0.125rem solid darken(@sapUiFieldActiveBorderColor, 5);
}

.sapMRangeSlider.sapMSlider {

	.sapMSliderLabels {
		height: 1rem;

		.sapMSliderRangeLabel {
			width: 2rem;
			font-size: var(--sapFontSmallSize);
			color: var(--sapContent_LabelColor);
		}
	}

	.sapMSliderInner .sapMSliderHandle {
		background: fade(@sapUiButtonBackground, 25);
	}

	.sapMSliderInner:not(.sapMSliderInnerDisabled) .sapMSliderHandle {

		&:hover {
			background-color: transparent;
			border-color: var(--sapButton_Hover_BorderColor);
		}

		&:active {
			background: transparent;
			border-color: var(--sapButton_Active_BorderColor);
		}

		&.sapMSliderHandlePressed {
			background: transparent;
			border-color: var(--sapButton_Active_BorderColor);
		}
	}

	.sapMSliderInner:not(.sapMSliderInnerDisabled) .sapMSliderProgress:hover ~ .sapMSliderHandle,
	.sapMSliderHandle:hover {
		background-color: fade(@sapUiButtonHoverBackground, 25);
		border-color: var(--sapButton_Hover_BorderColor);
	}
}
/* END "RangeSlider.less" */

/* START "RatingIndicator.less" */
/* ====================================== */
/* CSS for control sap.m/RatingIndicator  */
/* Fiori 3 theme                          */
/* ====================================== */

.sapMRI {
	text-shadow: var(--sapContent_TextShadow);

	.sapMRIUnsel {
		color: var(--sapContent_UnratedColor);
	}

	.sapMRISel {
		color: var(--sapContent_RatedColor);
	}

	.sapMRIHov {
		color: darken(@sapUiContentRatedColor, 5);
	}
}

.sapMRI.sapMRIDisplayOnly {
	text-shadow: none;

	.sapMRIIconSel {
		color: var(--sapTextColor);
	}
	.sapMRIUnsel {
		color: var(--sapContent_UnratedColor);
	}
}

.sapMRIDisabled {
	text-shadow: none;
	opacity: 0.4;
}

/* Custom focus outline */
html.sap-desktop .sapMRI:focus:not(.sapMRIDisabled):not(.sapMRIDisplayOnly) {
	outline: var(--sapContent_FocusWidth) var(--sapContent_FocusStyle) var(--sapContent_FocusColor);
	outline-offset: 0.0625rem;
}

.sapMRIIconSel,
.sapMRIIconUnsel,
.sapMRIIconHov,
.sapMRIIconReadOnly {
	font-size: 1.5rem;
}
/* END "RatingIndicator.less" */

/* START "ResponsivePopover.less" */
/* ======================================== */
/* CSS for control sap.m/ResponsivePopover  */
/* Fiori 3 theme                            */
/* ======================================== */

.sapMResponsivePopover.sapMDialog .sapMIBar.sapMPageHeader:before{
	border-top: none;
}

.sapMPopoverFooter .sapMTB .sapMBtn {
