}
/* END "ResponsivePopover.less" */

/* START "ScrollContainer.less" */
/* ====================================== */
/* CSS for control sap.m/ScrollContainer  */
/* Fiori 3 theme                          */
/* ====================================== */

html.sap-desktop:not(.sapUiNativeScrollbars) .sapMScrollContV::-webkit-scrollbar {
	width: 0.75rem;
	height: 100%;
}

html.sap-desktop:not(.sapUiNativeScrollbars) .sapMScrollContH::-webkit-scrollbar {
	width: 100%;
	height: 0.75rem;
}

html.sap-desktop:not(.sapUiNativeScrollbars) .sapMScrollContVH::-webkit-scrollbar {
	width: 0.75rem;
	height: 0.75rem;
}
/* END "ScrollContainer.less" */

/* START "SearchField.less" */
/* ================================== */
/* CSS for control sap.m/SearchField  */
/* Fiori 3 theme                      */
/* ================================== */

// ==========================================================================
// Variables overriding
// ==========================================================================

@_sap_m_SearchField_Height: 2.75rem;
@_sap_m_SearchField_ButtonSize: 2.125rem;
@_sap_m_SearchField_ButtonFontSize: 1rem;
@_sap_m_SearchField_Compact_FormPaddingLeft: 0.5rem;
@_sap_m_SearchField_ResetIcon: '\e03e';

.sapMSFF {
	border-radius: var(--sapField_BorderCornerRadius);
}

.sapMSFDisabled {
	opacity: 0.5;
}

/* custom buttons */
.sapMSFB:focus {
	outline: none;
}

.sapMBarChild > .sapMSFF > .sapMSFB {
	text-shadow: none;
}

.sapMFocus > .sapMSFF > .sapMSFB {
	color: var(--sapHighlightColor);
}

.sapMSFB:hover {
	background-color: var(--sapButton_Lite_Hover_Background);
}

.sapMSFF > .sapMSFB:not(.sapMSFBF):active,
.sapMSFF > .sapMSFB.sapMSFBA {
	background-color: var(--sapButton_Lite_Active_Background);
	color: var(--sapContent_ContrastIconColor);
}

.sapMSFB:first-of-type {
	margin-left: 0.5rem;
}

.sapUiSizeCompact {

	.sapMSFB:first-of-type {
		margin-left: 0;
	}
}
/* END "SearchField.less" */

/* START "SegmentedButton.less" */
/* ====================================== */
/* CSS for control sap.m/SegmentedButton  */
/* Fiori 3 theme                          */
/* ====================================== */

.sapMSegB {
	height: 2.75rem;
	vertical-align: top;
	position: relative;

	.sapMSegBBtn {

		.sapMSegBBtnInner {
			font-size: @sapMFontMediumSize;
			height: 2.25rem;
			line-height: 2.25rem;
			padding-left: 0.5625rem;
			padding-right: 0.5625rem;
			text-align: center;
			text-shadow: none;
			color: var(--sapButton_TextColor);
			border-top: 1px solid var(--sapButton_BorderColor);
			border-left: 1px solid var(--sapButton_BorderColor);
			border-bottom: 1px solid var(--sapButton_BorderColor);
			border-right: 1px solid transparent;
			background-color: var(--sapButton_Background);
		}

		&:not(.sapMSegBBtnMixed) .sapMImg {
			padding-left: 0.5625rem;
			padding-right: 0.5625rem;
		}
	}
}

.sapMSegBBtn:first-child .sapMSegBBtnInner {
	border-top-left-radius: 0.25rem;
	border-bottom-left-radius: 0.25rem;
}

.sapMSegBBtn:last-child .sapMSegBBtnInner {
	border-top-right-radius: 0.25rem;
	border-bottom-right-radius: 0.25rem;
}

html.sap-desktop .sapMSegBBtnFocusable:hover .sapMSegBBtnInner {
	background: var(--sapButton_Hover_Background);
}

/* Custom focus outline: */
html.sap-desktop {

	.sapMSegBBtnFocusable:focus .sapMSegBBtnInner {
		outline: 1px dotted;
		outline-offset: -3px;
		outline-color: var(--sapContent_FocusColor);
	}

	.sapMSegBBtnFocusable.sapMSegBBtnSel:focus .sapMSegBBtnInner {
		outline: 1px dotted;
		outline-offset: -3px;
		outline-color: var(--sapContent_ContrastFocusColor);
	}
}

.sapMSegB.sapMSegBIcons {

	.sapMSegBBtn:not(.sapMSegBBtnMixed) .sapMSegBBtnInner {
		padding: 0;
	}

	.sapMSegBBtn.sapMSegBBtnMixed .sapMImg {
		height: 2.125rem;
		width: auto;
		padding-right: 0.375rem;
	}

	.sapMSegBBtn.sapMSegBBtnMixed .sapUiIcon {
		padding-left: 0;
		padding-right: 0.375rem;
		width: 1rem;
	}
}

.sapMSegBBtn.sapMSegBBtnFocusable:active:hover {

	.sapMSegBBtnInner {
		background: var(--sapButton_Selected_Background);
		color: var(--sapButton_Selected_TextColor);
		border-color: var(--sapButton_Selected_BorderColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

.sapMSegBBtn.sapMSegBBtnSel {

	.sapMSegBBtnInner {
		background: var(--sapButton_Selected_Background);
		color: var(--sapButton_Selected_TextColor);
		border-color: var(--sapButton_Selected_BorderColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

.sapMSegBBtn.sapMSegBBtnSel:hover {

	.sapMSegBBtnInner {
		border-color: var(--sapButton_Selected_Hover_BorderColor);
	}
}

.sapMSegBBtnFocusable.sapMBtnActive {

	.sapMSegBBtnInner {
		background: var(--sapButton_Selected_Background);
		color: var(--sapButton_Selected_TextColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

html.sap-desktop .sapMSegBBtn.sapMSegBBtnFocusable.sapMSegBBtnSel:hover .sapMSegBBtnInner,
html.sap-desktop .sapMSegBBtnFocusable.sapMBtnActive:hover .sapMSegBBtnInner {
	background: var(--sapButton_Selected_Hover_Background);
}

.sapMSegBBtn.sapMSegBBtnFocusable.sapMSegBBtnSel {

	.sapMSegBBtnInner {
		border-right: 1px solid var(--sapButton_Selected_BorderColor);
	}

	.sapMSegBBtnInner:hover {
		border-right: 1px solid var(--sapButton_Selected_Hover_BorderColor);
	}

	/* Hide next button left border */
	+ .sapMSegBBtn .sapMSegBBtnInner {
		border-left: 1px solid transparent;
	}
}

.sapMSegB img {
	height: 2.125rem;
	width: auto;
	max-height: 2.125rem;
	vertical-align: top;
}

.sapMSegBBtn .sapUiIcon {
	width: auto;
	font-size: 1rem;
	line-height: 2.125rem;
	margin-right: 0;
	color: var(--sapButton_IconColor);
	vertical-align: top;
	text-align: center;
}

.sapMSegBBtn.sapMSegBBtnMixed .sapUiIcon {
	padding-right: 0.375rem;
}

.sapMSegBBtn .sapMBtnIcon::before {
	width: 1rem;
	text-align: center;
	display: inline-block;
}

.sapMSB .sapMSBInner .sapMSBText:not(.sapMSBTextIE) .sapMBtnInner {
	margin-right: 2.2rem;
}

.sapMSegBIcons:not(.sapMSegBBtnMixed) {

	.sapMImg,
	.sapUiIcon {
		padding-left: 0.5625rem;
		padding-right: 0.5625rem;
	}
}
/* Compact size */
.sapUiSizeCompact {

	.sapMSegBBtn .sapMSegBBtnInner {
		height: 1.625rem;
		line-height: 1.5rem;
		padding-left: 0.4375rem;
		padding-right: 0.4375rem;
	}

	.sapMSegBBtn:first-child .sapMSegBBtnInner {
		border-top-left-radius: 0.2rem;
		border-bottom-left-radius: 0.2rem;
	}

	.sapMSegBBtn:last-child .sapMSegBBtnInner {
		border-top-right-radius: 0.2rem;
		border-bottom-right-radius: 0.2rem;
	}

	.sapMSegB img {
		line-height: 1.5rem;
		height: 1.5rem;
		width: auto;
	}

	.sapMSegBBtn .sapUiIcon {
		font-size: 1rem;
		line-height: 1.5rem;
		width: 1.0rem;
		vertical-align: top;
	}
	.sapMSegB {

		.sapMBtnIconLeft {
			margin-left: 0;
		}
	}

	.sapMSegBIcons:not(.sapMSegBBtnMixed) {

		.sapMImg,
		.sapUiIcon {
			padding-left: 0.4375rem;
			padding-right: 0.4375rem;
		}
	}
	.sapMSegBIcons {

		.sapMSegBBtn.sapMSegBBtnMixed {

			.sapUiIcon,
			.sapMImg {
				padding-left: 0;
				padding-right: 0.375rem;
				margin: 0;
			}

			.sapMImg {
				height: 1.5rem;
				width: auto; /*1.5rem; */
			}
		}
	}
}

.sapMSegBBtn.sapMSegBtnLastVisibleButton .sapMSegBBtnInner {
	border-right: 1px solid var(--sapButton_BorderColor);
	border-top-right-radius: 0.2rem;
	border-bottom-right-radius: 0.2rem;
}
/* END "SegmentedButton.less" */

/* START "Select.less" */
/* ============================= */
/* CSS for control sap.m/Select  */
/* Fiori 3 theme                 */
/* ============================= */

/* IconOnly */

.sapMSlt.sapMSltIconOnly:not(.sapMSltDisabled) {
	border-color: var(--sapButton_Lite_BorderColor);
	background: var(--sapButton_Lite_Background);
	border-radius: 0.2rem;
}

/* IconOnly Hover */

.sapMSltIconOnly.sapMSltHoverable:hover:not(.sapMSltState) {
	background: var(--sapButton_Lite_Hover_Background);

	&.sapMSltWithIcon {
		border: 0.0625rem solid var(--sapButton_Lite_Hover_BorderColor);
	}
}

/*IconOnly Pressed */
.sapMSltPressed.sapMSltIconOnly:not(.sapMSltDisabled) {
	background: @sapUiToggleButtonPressedBackground;
	border: 0.0625rem solid @sapUiToggleButtonPressedBorderColor;
}

.sapMSlt:not(.sapMSltIconOnly) {
	border-radius: 0.125rem;
}

.sapMSlt {
	height: 2.25rem;
}

.sapMSltArrow {
	line-height: 2.25rem;
}

.sapMSltPressed > .sapMSltArrow::before {
	color: var(--sapButton_Active_TextColor);
}

html.sap-desktop .sapMSlt.sapMSltFocused:not(.sapMSltExpanded):not(.sapMSltDisabled) {

	&::before {
		pointer-events: none;
		content: '';
		position: absolute;
		left: 0;
		top: 0;
		right: 0;
		bottom: 0;
		z-index: 1;
		outline: 1px dotted var(--sapContent_FocusColor);
	}
}

html.sap-desktop .sapMSlt.sapMSltFocused:not(.sapMSltExpanded):not(.sapMSltDisabled):not(.sapMSltState)::before {
	outline-offset: -2px;
}

html.sap-desktop .sapMSlt.sapMSltFocused:not(.sapMSltExpanded):not(.sapMSltDisabled).sapMSltState::before {
	outline-offset: -2px;
}

html.sap-desktop .sapMSltIconOnly.focus:not(.sapMSltExpanded):not(.sapMSltDisabled).sapMSltPressed {
	outline-color: var(--sapContent_ContrastFocusColor);
}

.sapMSltHoverable:not(.sapMSltState):not(.sapMSltIconOnly):hover {
	border-color: var(--sapField_Hover_BorderColor);
	background: var(--sapField_Hover_Background);
}

/* pressed and hover */

.sapMSltIconOnly.sapMSltPressed.sapMSltHoverable:not(.sapMSltState):hover {
	background: @sapUiToggleButtonPressedHoverBackground;
	border-color: var(--sapField_Active_BorderColor);
}

/* value state */

.sapMSltState {
	border-width: 2px;
}

/* disabled */

.sapMSltDisabled {
	opacity: 0.5;
}

div.sapMSltPicker .sapMSltPickerValueState {
	box-shadow: inset 0 -0.0625rem @_sap_m_Dialog_HeaderShadowColor;
}
/* END "Select.less" */

/* START "SelectDialog.less" */
