/* CSS for control sap.m/SelectDialog  */
/* Fiori 3 theme                       */
/* =================================== */

.sapMSelectDialog.sapUiResponsivePadding--content .sapMDialogScrollCont {

	&.sapUi-Std-PaddingS {
		padding-left: 0rem !important;
		padding-right: 0rem !important;
