		background: var(--sapButton_Active_Background);
		border-color: var(--sapButton_Active_BorderColor);
	}
}

.sapMSliderTickLabel .sapMSliderLabel {
	padding-top: 0.4375rem;
	height: 1rem;
	width: 2rem;
	left: -1rem;
	font-size: var(--sapFontSmallSize);
