no special style for focus!

.sapUiLbxI:focus:not(.sapUiLbxIDis),
.sapUiLbxRo:not(.sapUiLbxIDis) > ul > .sapUiLbxI.sapUiLbxISel:focus,
.sapUiLbxStd > ul > .sapUiLbxISel > span:focus,
