.sapUiLbx:not(.sapUiLbxDis) > ul > .sapUiLbxI:focus:not(.sapUiLbxISel):not(.sapUiLbxIDis) > span {
	background-color: @sapUiListHoverBackground;
	color: @sapUiHighlightTextColor;
}
*/

